import { Component } from '@angular/core';
import {FormBuilder, FormControl, FormGroup, Validators} from "@angular/forms";
import {max} from "rxjs";
import {HttpClient, HttpParams} from "@angular/common/http";

@Component({
  selector: 'app-telegram-login',
  templateUrl: './telegram-login.component.html',
  styleUrls: ['./telegram-login.component.css']
})
export class TelegramLoginComponent {
  eventForm: any;
  constructor(private http: HttpClient, private fb: FormBuilder){}

  ngOnInit(): void {
    this.eventForm = this.fb.group({
      title: ['', Validators.required],
      description: [''],
      start: ['', Validators.required],
      end: ['', Validators.required],
      location: [''],
      timezone: Intl.DateTimeFormat().resolvedOptions().timeZone,
      recurring: [false],
      recurringOption: [''],
      until: ['']
    });
  }
  onsubmit(){
    const params = new HttpParams().set('number', "532453");
    this.http.get("https://localhost:44408/api/telegram-integration/number",{ params })
  }
}
<form [formGroup]="eventForm" autocomplete="off">
  <label>Number</label>
  <input autocomplete="off" formControlName="phoneNumber" type="text">
  <button type="button" (click)="onsubmit">Click</button>
</form>
